%[text] %[text:anchor:T_E42DFDB9] # **Sankey Chart Examples**
%[text] **Overview**
%[text] The `SankeyChart` comprises nodes and links. The links represent flow from one node to another, and the size of the link is proportional to the flow rate.
%[text] Clicking on a link provides more detailed information about the source and target nodes as well as the flow rate. Clicking on a node will highlight all incoming and outgoing links.
%[text] ![SankeyChart.png](text:image:4ce1)
%[text] **Documentation**
%[text] - [`digraph`](<matlab: doc("digraph")>): Graph with directed links
%[text] - [`patch`](<matlab: doc("patch")>): Create patches of colored polygons \
%[text:tableOfContents]{"heading":"**Table of Contents**"}
%%
%[text] %[text:anchor:H_5D5D2BC9] ## Define the chart data.
%[text] The chart data is specified using a directed graph. The links represent the flow between two nodes, using the weight to specify the flow rate.
sourceNodes = [1, 1, 2, 2, 3, 4, 5];
sinkNodes = [3, 4, 4, 5, 6, 6, 7];
flowRates = [4, 2, 3, 1, 4, 5, 1];
nodeLabels = ["A", "B", "C", "D", "E", "F", "G"];
DG = digraph( sourceNodes, sinkNodes, flowRates, nodeLabels );
%[text] Visualize the chart data using a directed graph plot.
figure %[output:39abc659]
plot( DG, "EdgeLabel", DG.Edges.Weight ) %[output:39abc659]
title( "Directed Graph" ) %[output:39abc659]
%%
%[text] %[text:anchor:H_57495E7D] ## Create a figure for the chart.
f = exampleFigure( "Name", "SankeyChart Example" ); %[output:379343bc]
%%
%[text] %[text:anchor:H_AD500169] ## Create the chart.
%[text] Next, create the chart object, specifying the `Parent` and `GraphData` properties.
SC = SankeyChart( "Parent", f, "GraphData", DG ); %[output:379343bc]
%%
%[text] %[text:anchor:H_B0ADC302] ## Change link properties.
%[text] %[text:anchor:H_1A3EE964] ### Color
%[text] The links' color can be specified as a single color, or can be connected to the nodes via the **`"source"`**, **`"target"`** and **`"gradient"`** options.
SC.LinkColor = "gradient"; %[output:3d9ad502]
%%
%[text] %[text:anchor:H_96CF7D2C] ### Type
%[text] We can adjust the shape of the chart's links. Options starting with "v" will have a constant vertical cross section while others have a constant perpendicular cross section.
SC.LinkType = "vtanh"; %[output:0794721e]
%%
%[text] %[text:anchor:H_622F0561] ## Change node properties.
%[text] %[text:anchor:H_3290A3D3] ### Color
%[text] We can modify the nodes' color using RGB triples.
SC.NodeColor(1,:) = [1, 0, 0]; %[output:0d053cdd]
%%
%[text] %[text:anchor:H_267C64FD] ### Vertical spacing
%[text] We can modify the vertical spacing as a percentage of the nodes' total height.
SC.NodePadRatio = 0.25; %[output:2356d4c2]
%%
%[text] %[text:anchor:H_8E333629] ### Width
%[text] Modify the nodes' width.
SC.NodeWidth = 0.2; %[output:69676103]
%%
%[text] %[text:anchor:H_35B38F48] ### Position
%[text] Reposition the nodes by specifying their $x$ and $y$ coordinates.
SC.XNodeData(end) = 3.5; %[output:0cbf2f20]
SC.YNodeData([3,4]) = SC.YNodeData([3,4]) + 2; %[output:0cbf2f20]
%%
%[text] %[text:anchor:H_2D3648D6] ### Label position
%[text] Modify the label position relative to the node.
SC.LabelAlignment = "bottom"; %[output:15ed7b21]
%%
%[text] %[text:anchor:H_24CE0453] ### Label content
%[text] Modify the label content to display the total flow or not.
SC.LabelIncludeTotal = "on"; %[output:09805c87]
%[text] For nodes that have different incoming and outgoing flows, the label will show the difference in the form: $\\left\\lbrace \\textrm{in}\\right\\rbrace \\longrightarrow \\left\\lbrace \\textrm{out}\\right\\rbrace${"editStyle":"visual"}.
%%
%[text] %[text:anchor:H_C26B03BB] ## Modify the chart data.
%[text] Let's display a more complex graph representing an energy flow diagram.
%[text] Load sample chart data, obtained from figure 1 in:
%[text] - Hay, B. & Hameury, Jacques & Scoarnec, V & Dav√©e, G & Grelard, M. (2011). *The Contribution of the Metrology of Thermophysical Properties of Materials in Automotive Design.* \
load( fullfile( chartsRoot(), "data", "Graph.mat" ) )
disp( linkData ) %[output:6c120ee3]
%[text] Create a graph from the link table.
DG = digraph( linkData );
%[text] Modify the data in the chart.
SC.GraphData = DG; %[output:55004b42]
%[text] Adjust the node position.
SC.YNodeData(13:end) = SC.YNodeData(13:end) - 50; %[output:55004b42]
%%
%[text] %[text:anchor:H_C1D6551E] ## Annotate the chart.
title( SC, "Diesel Engine Energy Flow" ) %[output:52737283]
%%
